  true,\n\t\"url\": null,\n\t\"notes\": \"Seventeen measurement stations in the south
  western region of the island of Oahu collected data at 1-second intervals over the
  course of a year.  The sensors are located in a 1-kilometer grid and the information
  then can be used to predict what PV outputs might be at 1-second intervals for medium-sized
  and large PV systems.  This DOE-funded study by NREL supports the Hawaii Clean Energy
  Initiative (HCEI), a multifaceted program to substantially increase the use of renewable
  energy in Hawaii.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
